import React from 'react';

const MovieDetails = ({ movie }) => {
  return (
    <div>
      <h2>{movie.title}</h2>
      <p>{movie.description}</p>
      <p>Category: {movie.category && movie.category.name}</p>
    </div>
  );
};

export default MovieDetails;
